<script>
import intro from 'intro.js';

window.intro = intro;
export default {
  name: 'diagram',
  data() {
    return {
      intro: intro.introJs(),
    };
  },
  methods: {
    startCaption() {
      this.intro.start();
    },
  },
  mounted() {
    this.intro.addStep({
      element: document.getElementById('mindcontrol_all'),
      intro: 'Step 1: The Healthy Brain Network dataset was hosted on Mindcontrol',
      position: 'right',
    });
    this.intro.addStep({
      element: document.getElementById('expert_all'),
      intro: 'Neuroimaging experts rated images as pass/fail & with confidence from 1(low) to 5(high)',
      position: 'right',
    });
    this.intro.addStep({
      element: document.getElementById('goldStd_all'),
      intro: 'Images rated as confident pass or confident fail by the top 4 experts were defined as the gold standard image set',
      position: 'right',
    });
    this.intro.addStep({
      element: document.getElementById('slice_all'),
      intro: '5 2D axial slices were generated from all 3D images',
      position: 'right',
    });
    this.intro.addStep({
      element: document.getElementById('braindr_all'),
      intro: 'The 2D slices were presented on the braindr app, where users could pass or fail the images by swiping',
      position: 'right',
    });
    this.intro.addStep({
      element: document.getElementById('crowd_all'),
      intro: 'We took the average of the crowd ratings, this led to an ROC area under the curve of 0.95',
      position: 'right',
